import React, { Component } from 'react'
import Nav from 'react-bootstrap/Nav'

import './'

import { Link } from 'react-router-dom'



class Topbar extends Component {

    constructor() {
        super()
    }



    render() {

        return (
            <Nav>
                <Nav.Item>
                    <Nav.Link>Active</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link>Link</Nav.Link>
                </Nav.Item>
            </Nav>
        )
    }

}

export default Topbar
